const c=(0,o.createTemplateFactory)({id:"ROcT8m8L",block:'[[[10,0],[14,0,"gbm-parent"],[15,"data-bs-theme",[52,[30,0,["isDarkMode"]],"dark","light"]],[12],[1,"\\n  "],[8,[39,2],[[24,0,"gbm-back-button link-underline-primary link-underline-opacity-0 link-underline-opacity-50-hover"]],[["@route"],["index"]],[["default"],[[[[1,"Back to Jonathan\'s Profile"]],[]]]]],[1,"\\n\\n  "],[10,0],[14,0,"container-fluid text-center py-5 px-3"],[12],[1,"\\n    "],[10,0],[14,0,"row"],[12],[1,"\\n      "],[10,0],[14,0,"col my-3"],[12],[1,"\\n        "],[10,3],[14,6,"https://github.com/NathanJang/MeowlWatch"],[14,"target","_blank"],[14,"rel","noopener noreferrer"],[12],[1,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/meowlwatch-logo-hd-0086f16fbe57c07e0697508d9726be45.png"],[14,0,"gbm-icon"],[14,"alt","App icon"],[12],[13],[1,"\\n        "],[13],[1,"\\n      "],[13],[1,"\\n    "],[13],[1,"\\n    "],[10,0],[14,0,"row my-2"],[12],[1,"\\n      "],[10,0],[14,0,"col"],[12],[1,"\\n        "],[10,"h2"],[12],[1,"\\n          Goodbye, MeowlWatch 👋\\n        "],[13],[1,"\\n        "],[10,2],[14,0,"text-muted"],[12],[1,"\\n          Jonathan Chan\\n        "],[13],[1,"\\n      "],[13],[1,"\\n    "],[13],[1,"\\n    "],[10,0],[14,0,"row justify-content-center text-start"],[12],[1,"\\n      "],[10,0],[14,0,"col-md-9 col-lg-8"],[12],[1,"\\n        "],[10,2],[12],[10,"em"],[12],[1,"April 7, 2020"],[13],[13],[1,"\\n        "],[10,2],[14,0,"lead"],[12],[1,"\\n          TL;DR:\\n          "],[10,3],[14,6,"https://github.com/NathanJang/MeowlWatch"],[14,"target","_blank"],[14,"rel","noopener noreferrer"],[14,0,"link-underline link-underline-opacity-25 link-underline-opacity-50-hover"],[12],[1,"MeowlWatch"],[13],[1,"\\n          will no longer be supported or updated, due to\\n          "],[10,3],[14,6,"http://dining.northwestern.edu"],[14,"target","_blank"],[14,"rel","noopener noreferrer"],[14,0,"link-underline link-underline-opacity-25 link-underline-opacity-50-hover"],[12],[1,"Northwestern Dining"],[13],[1,"\'s discontinuation of web services that\\n          are essential to the app.\\n        "],[13],[1,"\\n\\n        "],[10,0],[14,0,"gbm-body"],[12],[1,"\\n          "],[10,2],[12],[1,"\\n            MeowlWatch\'s main use case is for students to check their\\n            remaining meal plan balances through the app, after signing in once.\\n            This was accomplished by polling the web version of the balance\\n            check page on Northwestern Dining\'s own website, using NetID\\n            credentials that are securely stored on the user\'s device. At\\n            the time of writing, it appears that Northwestern Dining has\\n            permanently taken down this feature on their website, meaning\\n            MeowlWatch will no longer be able to provide the balance check\\n            feature either. I am no longer able to provide a meaningful app\\n            experience without this essential feature. This, coupled with the\\n            recent closure of campus facilities, has led me to discontinue the\\n            app.\\n          "],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            The rest of this post tells the story behind MeowlWatch, as a final\\n            reflection on this project that\'s become associated with my own\\n            journey at Northwestern. Perhaps its story can help you with your\\n            own project, too.\\n          "],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            "],[10,"strong"],[12],[1,"\\n              Scroll to the bottom for a dope graph :)\\n            "],[13],[1,"\\n          "],[13],[1,"\\n\\n"],[1,"\\n          "],[10,"hr"],[14,0,"my-5"],[12],[13],[1,"\\n          "],[10,2],[12],[10,"em"],[12],[1,"6 minute read"],[13],[13],[1,"\\n\\n          "],[10,"h3"],[12],[1,"The story of the Bodge 🔨"],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            It\'s been exactly three years since I first made that post on\\n            the Class of 2020 Facebook group — a little nervous since\\n            I\'m usually a private person, but also excited to share what I\\n            made with everyone. No more than a hastily\\n            "],[10,3],[14,6,"https://youtu.be/lIFE7h3m40U"],[14,"target","_blank"],[14,"rel","noopener noreferrer"],[14,0,"link-underline link-underline-opacity-25 link-underline-opacity-50-hover"],[12],[1,"bodged-together"],[13],[1,"\\n"],[1,"            app for me to check my own meal balances, it became obvious that\\n            this could be put to use for many more people. In a quiet little\\n            house in the suburbs of Houston, where I was visiting a friend over\\n            Spring Break in 2017, I got to work polishing it up, until it was\\n            neat enough for publication.\\n          "],[13],[1,"\\n          "],[10,0],[14,0,"text-center"],[12],[1,"\\n            "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/2017-screenshot-1-3a515b5b684c4acf0a12c37ba6078305.png"],[14,0,"img-fluid gbm-screenshot"],[14,"alt","Screenshots from 2017."],[12],[13],[1,"\\n            "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/2017-screenshot-2-4637f34c8e1111c053c083d05d27cf23.png"],[14,0,"img-fluid gbm-screenshot"],[14,"alt","Screenshots from 2017."],[12],[13],[1,"\\n            "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/2017-screenshot-3-7f08e99d931738a3513234fb03587d97.png"],[14,0,"img-fluid gbm-screenshot"],[14,"alt","Screenshots from 2017."],[12],[13],[1,"\\n            "],[10,2],[12],[10,"small"],[12],[1,"Screenshots from 2017."],[13],[13],[1,"\\n          "],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            The app was really simple at first, just a sign-in page and a simple\\n            key-value table of the user\'s remaining meal swipes.\\n            Eventually, other features got added, including directions to nearby\\n            dining locations and when they\'re open, as well as what\'s\\n            on the menu at each location. There were also certain integrations\\n            with the operating system, including the today-widget, native dark\\n            mode, some plans to include Siri integration (\\"Hey Siri,\\n            what\'s my Cat Cash balance?\\"), and an Apple Watch app. I\\n            even localised the app into Simplified and Traditional Chinese, and\\n            French. I wanted to make the app a fully-fledged iOS app experience,\\n            and definitely learned a lot about really specific parts of mobile\\n            app design and development that you just wouldn\'t think about\\n            unless you went through it.\\n          "],[13],[1,"\\n          "],[10,2],[12],[1,"Some thoughts off the top of my head:"],[13],[1,"\\n          "],[10,"ul"],[12],[1,"\\n            "],[10,"li"],[12],[1,"How do you present all this information in a clean way, but also\\n              without making the user do a single tap to get what they need?\\n              Empathy is key in design."],[13],[1,"\\n            "],[10,"li"],[12],[1,"What extra features could I add on top of the main use case,\\n              without making the app lose its focus?"],[13],[1,"\\n            "],[10,"li"],[12],[1,"How do you translate a specific, local concept like \\"meal\\n              exchange/equivalency\\" into another language, like Chinese and\\n              French?"],[13],[1,"\\n            "],[10,"li"],[12],[1,"How do you balance the wants of the user, like an Android\\n              version, with my selfish want to implement niche things like\\n              localisation and iOS integration, instead? Sorry, user :)"],[13],[1,"\\n            "],[10,"li"],[12],[1,"Is this entrepreneurship, a public service, or my own\\n              playground? It definitely didn\'t earn any money."],[13],[1,"\\n            "],[10,"li"],[12],[1,"Turns out Apple is pretty strict when it comes to In-App\\n              Purchases, as frustrating as it was to work with such a buggy\\n              library."],[13],[1,"\\n          "],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            The code has gotten messy from years of me throwing features in,\\n            here and there. It might be a good thing that I can spare someone\\n            the torment of trying to pick up this project. That being said, I\\n            would never have been able to launch this if I waited until it was\\n            perfect — it would never be. Sometimes you just need to lower\\n            your impossible standards to make progress, and that\'s okay.\\n          "],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            And with that, this is what I eventually came up with, through many\\n            iterations:\\n          "],[13],[1,"\\n          "],[10,0],[14,0,"text-center"],[12],[1,"\\n            "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-1-a5674693e98bcae0659b668429b38314.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[1,"\\n            "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-2-51d891639b53723885fed17be293ac2a.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[1,"\\n            "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-3-ea5273582c289a3d15e71e0de446c0c6.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[1,"\\n            "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-4-ccf9c60ed38914ef7d702db5ad0216ec.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[1,"\\n            "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-5-0978ca81ec69b564b07803c49b990305.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[1,"\\n            "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-6-57790d5d5b08d22e655d4eb7baab06ca.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[1,"\\n            "],[10,2],[12],[10,"small"],[12],[1,"Screenshots of the final version."],[13],[13],[1,"\\n          "],[13],[1,"\\n\\n          "],[10,"h3"],[12],[1,"Looking back 👀"],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            I never expected it to get this far, at all. The way the app pulled\\n            meal balance data is undocumented at best, and criminal at worst. At\\n            one point, I tried to get Northwestern Dining to at least help me\\n            advertise the app, but that discussion didn\'t go anywhere, so\\n            the app stayed unsanctioned. I half-expected an inevitable\\n            strongly-worded letter from someone about unauthorised use of the\\n            school network, considering a good amount of traffic to their server\\n            would have been from my users. That letter never came, though, to my\\n            relief.\\n          "],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            Maybe at some point someone developed a routine to check their\\n            Equivalency balance every week before they expired. Maybe someone\\n            got crazy tipsy but still had their wits together to check on their\\n            points before buying out the chips and salsa shelf at Lisa\'s.\\n            These stories, I\'ll never know, but I sincerely hope that this\\n            app has been useful to someone out there. If you have a story,\\n            "],[8,[39,2],null,[["@route"],["index"]],[["default"],[[[[1,"let me know"]],[]]]]],[1,"! I\'d love to hear\\n            it.\\n          "],[13],[1,"\\n\\n          "],[10,0],[14,0,"text-center"],[12],[1,"\\n            "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/app-store-reviews-3b8d464a7968d8344261e5d60babe1dc.png"],[14,0,"gbm-info-image"],[14,"alt","Screenshot of App Store reviews"],[12],[13],[1,"\\n            "],[10,2],[12],[10,"small"],[12],[1,"Screenshot of App Store reviews."],[13],[13],[1,"\\n          "],[13],[1,"\\n\\n          "],[10,2],[12],[1,"\\n            Thanks are due to my friends and family, who empowered me to keep up\\n            with this project. I couldn\'t have done this without their\\n            support.\\n          "],[13],[1,"\\n\\n          "],[10,"h3"],[12],[1,"Looking forward 👏"],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            There are many other app opportunities in on-campus food that\\n            MeowlWatch could have ventured into. I challenge anyone able, and\\n            still participating on campus, to make something that can make the\\n            lives of those around you better. Some ideas:\\n          "],[13],[1,"\\n          "],[10,"ul"],[12],[1,"\\n            "],[10,"li"],[12],[1,"An app to distribute your student group\'s leftovers from\\n              catering."],[13],[1,"\\n            "],[10,"li"],[12],[1,"An app to offer meal swipes to students who may not be\\n              food-secure."],[13],[1,"\\n            "],[10,"li"],[12],[1,"An app for students to offer to pick up food for others in the\\n              same dorm, from a restaurant that they were going to anyway."],[13],[1,"\\n          "],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            The\\n            "],[10,3],[14,6,"https://github.com/NathanJang/MeowlWatch"],[14,"target","_blank"],[14,"rel","noopener noreferrer"],[14,0,"link-underline link-underline-opacity-25 link-underline-opacity-50-hover"],[12],[1,"source code"],[13],[1,"\\n            will remain available online for reference only. If you\'d like\\n            to fork this project, please let me know!\\n          "],[13],[1,"\\n\\n          "],[10,"h3"],[12],[1,"Technical FAQ 🤓"],[13],[1,"\\n          "],[10,2],[12],[10,"em"],[12],[1,"How did you pull user data from Northwestern?"],[13],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            On the web page, the browser makes a series of HTTP GET/POST\\n            requests to take the user through the NUIT SSO flow. All I did was\\n            step through it, mimic it with code, and then parse the response\\n            into the app. So, yes, probably against their TOS. I suspect this\\n            approach won\'t work anymore if Northwestern ups their security,\\n            like with MFA, so future projects like this should definitely check\\n            in with NUIT first.\\n          "],[13],[1,"\\n\\n          "],[10,2],[12],[10,"em"],[12],[1,"How much money did you make from this?"],[13],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            Net loss. It cost $100 per year to host stuff on the App Store, ad\\n            revenue and tips couldn\'t make up for it, and I couldn\'t\\n            be bothered to look for other revenue streams. I did have\\n            entrepreneurial plans at first, but I made it closer to a public\\n            utility as time went on. I kept it up for as long as people were\\n            using it :)\\n          "],[13],[1,"\\n\\n          "],[10,"h3"],[12],[1,"Finishing Stats 🏁"],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            I am incredibly humbled that MeowlWatch has had, through its\\n            three-year lifetime, since launching in 2017, on a campus of about\\n            8,000 undergrads:\\n          "],[13],[1,"\\n          "],[10,"ul"],[12],[1,"\\n            "],[10,"li"],[12],[1,"More than 8,000 unique downloads"],[13],[1,"\\n            "],[10,"li"],[12],[1,"A few thousand weekly app sessions (estimated), before campus\\n              closure"],[13],[1,"\\n            "],[10,"li"],[12],[1,"More than 123,000 lifetime opt-in app sessions"],[13],[1,"\\n            "],[10,"li"],[12],[1,"More than 140,000 impressions on the App Store"],[13],[1,"\\n            "],[10,"li"],[12],[1,"4.9 out of 5 stars on the App Store, over 50 reviews"],[13],[1,"\\n            "],[10,"li"],[12],[1,"Dozens of users who chose to support the app financially"],[13],[1,"\\n          "],[13],[1,"\\n          "],[10,0],[14,0,"text-center"],[12],[1,"\\n            "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/asc-daily-users-0ad7dec1cb3e3eacdfbef67c5aec40eb.png"],[14,0,"gbm-info-image"],[14,"alt","Graph of opt-in daily users since 2017."],[12],[13],[1,"\\n            "],[10,2],[12],[10,"small"],[12],[1,"Graph of opt-in daily app sessions since 2017, coinciding\\n                with the quarter system calendar."],[13],[13],[1,"\\n          "],[13],[1,"\\n          "],[10,2],[12],[1,"\\n            Thanks to everyone for your support! Take care.\\n          "],[13],[1,"\\n        "],[13],[1,"\\n      "],[13],[1,"\\n    "],[13],[1,"\\n  "],[13],[1,"\\n"],[13]],[],["div","if","link-to","a","img","h2","p","em","strong","hr","h3","small","ul","li"]]',moduleName:"jonathanchan-me/components/goodbye-meowlwatch-content.hbs",isStrictMode:!1})
